import React, { Component } from 'react'
import { Row, Col } from 'antd'
import DynamicLeft from './DynamicLeft';
import DynamicMid from './Mid';
import DynamicRight from './Right';

class QjDynamic extends Component {

    render() {
        return (
            <div className='qj-level'>

                <div className='tangle hoverable'>
                    {/* <img  /> */}
                    <span>强军阶梯</span>
                </div>
                <Row style={{ marginTop: "10px", height: "233px" }}>
                    <Col span={6}  >
                        <DynamicLeft />
                    </Col>
                    <Col span={6}>
                        <DynamicMid />
                    </Col>
                    <Col span={12}>
                        <DynamicRight />
                    </Col>
                </Row>
            </div>
        )
    }
}

export default QjDynamic;
